import * as React from 'react'
import TodoTable from "./todoTable"

export default class TodoComponent extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            todos: {},
            request: Request.NONE
        }
    }

    render() {
        switch (this.state.request) {
            case Request.ERROR: return <div>There was an error retrieving TODO's</div>
            case Request.PENDING: return <div>Loading... todo's</div>
            case Request.SUCCESS: return <TodoTable />
            default : return <div>Please, do search todo's</div>
        }
    }
}
